description:
EasyWay mobile – current public transport routes in your mobile

Service is provided in:
- Ukraine (73 major cities);
- Bulgaria (Sofia, Burgas, Pleven, Plovdiv, Varna);
- Croatia (Zagreb, Rijeka, Split);
- Greece (Athens, Thessaloniki, Patras);
- Moldova (Chisinau, Tiraspol, Bender, Balti);
- Serbia (Belgrade);
- Turkey (Istanbul, Ankara, Adana, Antalya, Bursa, Denizli, Diyarbakir, Eskisehir, Gaziantep, Izmir, Kayseri, Konya, Mersin, Sanliurfa).

Realtime data is provided in the selected cities, partial coverage may apply:
 - Ukraine (All major cities where real-time data is not prohibited by security rules);
 - Moldova (Chisinau)
 - Bulgaria (Varna)

Features:
 - Offline-mode;
 - Optimal A to B route search;
 - Full list of current public transport routes, display-on-the-map possibility in the provided cities
 - Route scheme, schedule or interval, service time and travel cost;
 - GPS tracking of your movement;
 - Public Transport GPS-data for selected cities;
 - Real-time Stop schedule and Route direction;
 - Bookmarks, Cities and Routes Cache for traffic optimization;
 - Information on wheelchair accessible transport;
 - Multi-language interface.

The application will be useful to all users of public transport in a number of Ukrainian cities: Berdychiv, Bila Tserkva, Varash, Drohobych, Dubno, Zhytomyr, Transcarpathia, Zvyagel, Ivano-Frankivsk, Kamianets-Podilskyi, Kamianske, Kovel, Kolomyia, Korosten, Kramatorsk , Lviv, Mukachevo, Oleksandria, Pavlograd, Rivne, Sloviansk, Uzhhorod, Khmelnytskyi, Cherkasy, Chernihiv, Chortkiv.

Traffic data is received online through the GPS navigation system.

The program can:
- display on the map where your trolleybus or minibus is now and show the direction of its movement;
- determine the actual arrival time of public transport at each stop;
- show on the map a complete list of city transport routes, both municipal trolleybuses and private buses;
- show transport adapted for people with limited mobility;
- display your location based on GPS data, so you can find the nearest stop;
